import React from 'react'

const Card = ({ id, name, email }) => {
    return(
        <div className='tc bg-light-green dib br3 pa3 ma2 grow bw2 shadow-5'>

                <img src={`https://robohash.org/set_set3/bgset_bg1/${id}?size=200x200`} alt='Card'/>
            <div>
                <h2>{name}</h2>
                <p>{email}</p>
            </div>
        </div>        
    );
}

export default Card;
